import React from "react";
import styled from "styled-components";
import './App.css';

const Button = styled.button`
  background-color: #282c34;
  color: white;
  font-size: 16px;
  padding: 10px 10px;
  border-radius: 10px;
  margin: 10px 0px;
  cursor: pointer; 
`;


function Search ()  {
    <form action="/" method="get"> 
        <label htmlFor="header-search">
            <span className="visually-hidden">How do you feel today?</span>
        </label>
        <input
            className = "input"
            type="text"
            id="header-search"
            placeholder="Express yourself"
            name="s" 
        />
        <Button>
            Receive Advice
        </Button>
    </form>
};

export default Search;
